import React from "react"
import productData from "../asset/data"

const Product = () => {

    console.log(productData[0].image1)
 
     
    

    return(
        <div>

            {
                productData.length === 0 ?
                (<div> No data found </div>):
                (productData.map((product) => (
                    <div key={product.id}>

                        
                      <div>
                        </div>  
                        

                    </div>
                )))
            }
     

        </div>
    )
}

export default Product;
